$(document).ready(function(){console.log("ready!"),$(".scroll-wrap").css("height",$(window).height()),$('.scroll-wrap[data-type="background"]').each(function(){var o=$(this);$window=$(window),$(window).scroll(function(){var a=-($window.scrollTop()/o.data("speed")),c="50% "+a+"px";o.css({backgroundPosition:c})})}),$(".wrapper").snapscroll(),$(".scroll-wrap:nth-child(3)").waypoint(function(){alert("Basic example callback triggered.")})});